import React from 'react';

const Home = () => {
    return <>
        <section className={'home1'} id='home'>
            <div >
                <div className={'home_description'}>Hi </div>
                <div className={'home_name'}>Grzegorz Kaczor</div>
                <div className={'home_description'}>Web developer</div>
            </div>
        </section>
    </>
};

export default Home;
